import React from "react";
import "./style.css";

const Input = ({ values }) => {
  return (
    <div className="app">
      {values.map((item) => (
        <div key={item.type}>
          <div>
            {item.error ? (
              <input
                className="error-form-input"
                type={item.type}
                name={item.type}
                placeholder={item.type}
              />
            ) : (
              <input
                className="form-input"
                type={item.type}
                name={item.type}
                placeholder={item.type}
              />
            )}

            {item.error ? <p>{item.errorMessage}</p> : null}
          </div>
        </div>
      ))}
    </div>
  );
};

export default Input;
